import { IANAZone, Zone } from "luxon";

export class Location {
  id: string;
  latitude: number;
  longitude: number;
  // meters
  elevation: number;
  names: Map<string, string>;
  zone: Zone;

  constructor(latitude: number, longitude: number, elevation: number, names: Map<string, string>, zone: Zone) {
    this.id = names.get("en-gb");
    this.latitude = latitude;
    this.longitude = longitude;
    this.elevation = elevation;
    this.names = names;
    this.zone = zone;
  }

}

